const FunctionState = () => {

    const[count, setCount] = useState(0)

    const AddOne = ()=>{
        setCount(count +1)
    } 

    return(
        <div>
            <p>number of click:{count} </p>
            <button onClick={AddOne} >Click me</button>
        </div>
    )
}

